import React from 'react';

const Footer = () => {
  return (
    <footer className="footer">
      <p className="mb-1">Built for DSW Hackathon 2025 | Team InsureTech Innovators</p>
      <p className="text-sm">Powered by Advanced AI Technology</p>
    </footer>
  );
};

export default Footer;
